import React from 'react';

const DropDownList = (props) =>{
    return(
        <div className="Dropdown-list">
            {Object.keys(props.list).map((data)=>{
                return (<div className="list" key={data}>
                    {props.showCategory? <h1 className="category">{data}</h1> : null}
                    <SubList list={props.list[data]} select={props.selectItem}/>
                </div>)
            })}
        </div>
    )
}

const SubList = (props) =>{
    return (
        <div style={{display: 'flex', flexDirection: 'column'}}>
            {props.list.map((data)=>{
                return <h1 className="rowText" onClick={()=>props.selectItem(data)}>{data.name}</h1>
            })}
        </div>
    )
}

export default DropDownList;
